import React from 'react';

export default function ContactScreen() {

  return (
    <div>
      <h2>Contact Us By Phone</h2>
          <p>
              604 - xxx -xxxx
          </p>

      <h2>Reach Us Via Email</h2>
          <p>
              support@luxeshop.com
          </p>

      <h2>Contact Us Via Live Chat</h2>
          <p>
              Click here to reach a live customer service representative.
         </p>

      </div>
  );
}
